WITH users AS (
SELECT DISTINCT hs_activities.user_id
FROM hs_activities
)
SELECT jsonb_build_object('by_list', ( SELECT array_agg(users.user_id) AS array_agg FROM users)) AS params;

SELECT 
	('{"params": '||(jsonb_build_object('time_slot[start]', to_char (date_trunc('day',  (MAX(time_slot) - '1 day'::interval) AT TIME ZONE 'UTC'), 'YYYY-MM-DD"T"HH24:MI:SS"Z"'), 
					   'time_slot[stop]', to_char (date_trunc('day',  (MAX(time_slot) + '5 days'::interval) AT TIME ZONE 'UTC'), 'YYYY-MM-DD"T"HH24:MI:SS"Z"')
						  ))::text||'}')::jsonb AS params
FROM hs_activities;

